import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonMenuButton, IonButtons, IonMenu, IonList, IonItem, IonButton } from '@ionic/react';
import React from 'react';

//Page components
import LogIn from '../components/LogIn';
import './Home.css';


class Home extends React.Component {

  render() {

    return (
      <>
        <IonMenu side="start" content-id="main-content">
          <IonHeader>
              <IonToolbar color="primary">
                <IonTitle id="page-title">UMFit</IonTitle>
              </IonToolbar>
          </IonHeader>
          <IonContent>
            <IonList>
              <IonItem>Menu Item</IonItem>
              <IonItem>Menu Item</IonItem>
              <IonItem>Menu Item</IonItem>
              <IonItem>Menu Item</IonItem>
              <IonItem>Menu Item</IonItem>
            </IonList>
          </IonContent>
        </IonMenu>

        <IonPage id="main-content">
          <IonHeader>
            <IonToolbar>
              <IonButtons slot="start">
                <IonButton></IonButton>
              </IonButtons>
              <IonTitle>Menu</IonTitle>
            </IonToolbar>
          </IonHeader>
          <IonContent>
            <IonContent class="background-image"></IonContent>
            <LogIn />
          </IonContent>
        </IonPage>
      </>
      );
  }

};

export default Home;
